import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  root: {
    "& .MuiFormControl-root": {
      width: "80%",
      margin: theme.spacing(1),
    },
  },
  pageContent: {
    padding: theme.spacing(5),
    margin: theme.spacing(5),
  },
  creditContainer: {
    padding: theme.spacing(2),
  },
}));
